function App() {
  return (
    <>
      <NavBar />
      <div className="container-sm body-container">
        <div className="d-flex justify-content-between align-items-center">
          <div>
            <h1>Blog posts</h1>
          </div>
          <div>
            <button className="btn btn-sm btn-primary ">
              Create
              <ImFolderPlus className="me-1" />
            </button>
          </div>
        </div>
        <div>
          <Table />
        </div>
      </div>
    </>
  );
}

export default App;
